import React, { Component } from 'react';
import '../App.css';
import { Redirect } from 'react-router';
// import Navigationbar from './Navigationbar'
import backGroundImage from "./images/landingPageImage.jpg"
import CustomerCarousel from "./images/yelp_logo.png"
import OwnerCarousel from "./images/yelp_logo.png"
import { Carousel, Navbar, Form, Nav, NavDropdown, FormControl } from 'react-bootstrap';


var backgroundImagePic = {
    backgroundImage: `url(${backGroundImage})`,
    // height: 100%
    // width: 100%
}

class LandingPage extends Component {
    render() {
        return (
            <div style={backgroundImagePic}>
                <Navbar bg="light" variant="light">
                <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Write a review</Nav.Link>
                            <Nav.Link href="#features">Events</Nav.Link>
                            <Nav.Link href="#pricing">Talks</Nav.Link>
                        </Nav>
                        <Form inline>
                        <NavDropdown title="Login" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Customer login</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Restautant login</NavDropdown.Item>
                        </NavDropdown>
                        <NavDropdown title="Signup" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Customer Signup</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Restautant Signup</NavDropdown.Item>
                        </NavDropdown>
                        </Form>
                    </Navbar.Collapse>
                </Navbar>
                    <center>
                        <Carousel>
                            <Carousel.Item>
                                <img
                                    className="d-block w-100"
                                    src={CustomerCarousel}
                                    alt="Customer"
                                />
                            </Carousel.Item>
                            <Form inline>
                                <FormControl type="text" placeholder="restaurants, delivery..." className="mr-sm-2" />
                            </Form>
                        </Carousel>
                    </center>
            </div>
        )
    }
}

export default LandingPage;
